import React from "react";

const Search = () => {
  return (
    <div className="flex items-center rounded-lg p-5 gap-">
      <input
        type="search"
        placeholder="Search for something..."
        className="w-full pl-10 text-sm text-gray-900 bg-gray-50 rounded-lg border border-gray-300 focus:ring-blue-500 focus:border-blue-500"
      />
      <button
        type="submit"
        className="text-white bg-blue-700 hover:bg-blue-800 focus:ring-4 focus:outline-none focus:ring-blue-300 font-medium rounded-lg text-sm px-4 py-2"
      >
        Search
      </button>
    </div>
  );
};

export default Search;
